import React from 'react';
import logo from '../logo.png';
import {Link} from 'react-router-dom';
import styled from 'styled-components';

const Termsbutton = styled(Link)`
`;
const AddaccountButton = styled(Link)`
`;

const information = () => {
    return (
        <div className='information pt6'>
            <div className="container">
                <div className="row">
                    <div className="col-sm-4 info-profile">
                            <div className="img-holder">
                                <img src={logo} />
                            </div>
                        <div className="file btn btn-lg btn-primary btn-upload">Ngarko logo
                            <input type="file" name="file" className="btn-upload-input"/>
                        </div>
                    </div>
                    <div className="col-sm-4">
                        
                    </div>
                    <div className="col-sm-4 left-buttons">
                        <Termsbutton type="button" className="btn btn-success btn-size-2" to={'./allpartners'} >Terms and Condition</Termsbutton>
                        <AddaccountButton type="button" className="btn btn-success btn-size-2" to={'./allpartners'} >Krijo përdorues të ri</AddaccountButton>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default information
